DROP TABLE IF EXISTS `transportistas-Transporte`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `transportistas-Transporte` (
  `idTransportista` int NOT NULL AUTO_INCREMENT COMMENT 'ID DEL TRANSPORTISTA ENT ABLA',
  `idUsuario_Transportista` int DEFAULT NULL COMMENT 'id de la tabla TM_USUARIO',
  `idTransportistaLeader` varchar(225) DEFAULT NULL COMMENT 'ID Del transportista que nos viene en la orden.',
  `emailTransportista` varchar(225) DEFAULT NULL COMMENT 'Email del transportista',
  `nombreTransportista` varchar(255) DEFAULT NULL COMMENT 'CONDUCTOR_NOMBRE',
  `direccionTransportista` varchar(255) DEFAULT NULL,
  `poblacionTransportista` varchar(225) DEFAULT NULL COMMENT 'Poblacion del Transportista',
  `provinciaTransportista` varchar(225) DEFAULT NULL,
  `cpDireccionTransportista` varchar(10) DEFAULT NULL COMMENT 'Codigo postal del transportista',
  `nifTransportista` varchar(255) DEFAULT NULL,
  `tractoraTransportista` varchar(225) DEFAULT NULL,
  `firmaTransportista_transportistasTransporte` longtext COMMENT 'Firma predeterminada del conductor, se añade en el perfil	',
  PRIMARY KEY (`idTransportista`)
) ENGINE=InnoDB AUTO_INCREMENT=125 DEFAULT CHARSET=utf8mb4;
